<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Олимпиада Геннадиевна Крылова родился двенадцатого августа 1975. <br><p>Седьмого февраля 2230 устроился на работу в Фонд на должность операциониста. </p><p>	Окончательно уволится двадцать седьмого декабря 2192. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
